    <>
      <div className="App">
        <div className='overlay' onAnimationEnd={()=>setIsButton(true)}>
          {isButton?<button className='playBtn'>Play</button>:""}


        </div>



        <div className='container'></div>


      </div>

    </>

  );
}

export default App;
